(26, 49, 'Fragments', 'https://reactjs.org/docs/fragments.html', 'A common pattern in React is for a component to return multiple elements. Fragments let you group a list of children without adding extra nodes to the DOM.<br>There is also a new short syntax for declaring them.<br>A common pattern is for a component to return a list of children. Take this example React snippet:<br><Columns /> would need to return multiple <td> elements in order for the rendered HTML to be valid. If a parent div was used inside the render() of <Columns />, then the resulting HTML will be invalid.<br>results in a <Table /> output of:<br>Fragments solve this problem.<br>which results in a correct <Table /> output of:<br>There is a new, shorter syntax you can use for declaring fragments. It looks like empty tags:<br>You can use <></> the same way youd use any other element except that it doesnt support keys or attributes.<br>Fragments declared with the explicit <React.Fragment> syntax may have keys. A use case for this is mapping a collection to an array of fragments  for example, to create a description list:<br>key is the only attribute that can be passed to Fragment. In the future, we may add support for additional attributes, such as event handlers.<br>You can try out the new JSX fragment syntax with this CodePen.<br>Copyright  2020 Facebook Inc.<br>', 'data:image/svg+xml;base64,', 'active', NULL, 0, 4, 'image', '1', NULL, NULL, '0', NULL, 0, 'publish', NULL, NULL, NULL, '2020-08-25', '2020-09-24 04:44:32', NULL),
