(56, 56, 'Set the Authorization Header with Axios', 'https://masteringjs.io/tutorials/axios/authorization', 'Setting request headers with Axios is easy.\r\nHere\'s how you can set the Authorization header, which is typically used to send\r\naccess tokens to a server.<br>HTTP headers are case-insensitive, so whether you use \'authorization\'\r\nor \'Authorization\' doesn\'t matter.<br>The actual format of the authorization header depends on what auth\r\nstrategy the server uses. For example, here\'s how you can use Basic Auth with Axios.<br>Setting the authorization header is a little different with post(),\r\nbecause the 2nd parameter to post() is the request body. You should pass\r\nthe headers as the 3rd parameter to post() and put().<br>', 'https://masteringjs.io/assets/logo.svg', 'active', 'done', 0, 4, 'image', '1', '2020-09-09', NULL, '0', NULL, 0, 'publish', NULL, NULL, NULL, '2020-09-08', '2020-09-24 04:33:55', NULL),
